                      className: "slide-review",
                      children: "\u0414\u043E\u043B\u0433\u0438\u0435 \u043F\u043E\u0438\u0441\u043A\u0438 \u0435\u0434\u0438\u043D\u0441\u0442\u0432\u0435\u043D\u043D\u043E\u0433\u043E \u0438 \u043D\u0435\u043F\u043E\u0432\u0442\u043E\u0440\u0438\u043C\u043E\u0433\u043E \u043C\u0430\u0441\u0442\u0435\u0440\u0430 \u043D\u0430 \u043C\u043D\u043E\u0433\u043E\u0441\u0442\u0440\u0430\u0434\u0430\u043B\u044C\u043D\u044B\u0439 \u0441\u0430\u0439\u0442 www.cielparfum.com, \u043A\u043E\u0442\u043E\u0440\u044B\u0439 \u0431\u044B\u043B \u0441\u043E\u0431\u0440\u0430\u043D \u043A\u0440\u0430\u0439\u043D\u0435 \u043D\u0435\u043A\u043E\u043C\u043F\u0435\u0442\u0435\u043D\u0442\u043D\u044B\u043C \u043F\u0440\u043E\u0433\u0440\u0430\u043C\u043C\u0438\u0441\u0442\u043E\u043C \u0438 \u0440\u0430\u0437 \u0432 \u043C\u0435\u0441\u044F\u0446 \u0441\u0442\u0430\u0431\u0438\u043B\u044C\u043D\u043E \u0433\u0440\u043E\u0437\u0438\u043B \u043F\u043E\u0433\u0438\u0431\u043D\u0443\u0442\u044C, \u043F\u0440\u0438\u0432\u0435\u043B\u0438 \u043C\u0435\u043D\u044F \u043D\u0430 \u0441\u0430\u0439\u0442 \u0438, \u0432 \u0438\u0442\u043E\u0433\u0435, \u043A \u0440\u0435\u0431\u044F\u0442\u0430\u043C \u0438\u0437 Drupal-coder. \u0418 \u0432\u043E\u0442 \u0443\u0436\u0435 \u043F\u0440\u0430\u043A\u0442\u0438\u0447\u0435\u0441\u043A\u0438 \u043F\u043E\u043B\u0433\u043E\u0434\u0430 \u043A\u0430\u043A \u043D\u0435 \u043F\u0440\u043E\u0445\u043E\u0434\u0438\u0442 \u0438 \u0434\u043D\u044F, \u0447\u0442\u043E\u0431\u044B \u044F \u043D\u0435 \u043F\u043E\u0443\u0434\u0438\u0432\u043B\u044F\u043B\u0430\u0441\u044C \u0438 \u043D\u0435 \u043F\u043E\u0440\u0430\u0434\u043E\u0432\u0430\u043B\u0430\u0441\u044C \u0441\u0432\u043E\u0435\u043C\u0443 \u0432\u0435\u0437\u0435\u043D\u0438\u044E! \u041F\u043E\u0447\u0438\u043D\u0438\u043B\u0438 \u0432\u0441\u0435, \u0447\u0442\u043E \u043D\u0435 \u0440\u0430\u0431\u043E\u0442\u0430\u043B\u043E - \u043E\u0442 \u043F\u043E\u0438\u0441\u043A\u0430 \u0434\u043E \u043E\u0442\u043E\u0431\u0440\u0430\u0436\u0435\u043D\u0438\u044F \u043C\u0435\u043D\u044E. \u041F\u0440\u043E\u0432\u0435\u043B\u0438 \u0440\u0435\u0434\u0438\u0437\u0430\u0439\u043D - \u043D\u0435 \u043E\u0442\u0445\u043E\u0434\u044F \u043E\u0442 \u0436\u0435\u043B\u0430\u0435\u043C\u043E\u0433\u043E, \u043D\u043E \u0441\u043E \u0441\u0432\u043E\u0438\u043C\u0438 \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u0435\u043D\u043D\u044B\u043C\u0438 \u0438 \u043A\u0430\u0447\u0435\u0441\u0442\u0432\u0435\u043D\u043D\u044B\u043C\u0438 \u0434\u043E\u043F\u043E\u043B\u043D\u0435\u043D\u0438\u044F\u043C\u0438. \u041E\u0441\u0443\u0449\u0435\u0441\u0442\u0432\u0438\u043B\u0438 \u0440\u044F\u0434 \u043F\u0440\u043E\u0435\u043A\u0442\u043E\u0432 - \u043A\u043E\u043D\u043A\u0443\u0440\u0441\u044B, \u0442\u0435\u0441\u0442\u044B \u0438 \u0442\u0434. \u0410 \u0443\u0436 \u043C\u0435\u043B\u043A\u0438\u0445 \u043F\u043E\u0447\u0438\u043D\u043E\u043A \u0438 \u0434\u043E\u0440\u0430\u0431\u043E\u0442\u043E\u043A - \u043D\u0435 \u0441\u0447\u0435\u0441\u0442\u044C! \u0418 \u0433\u043B\u0430\u0432\u043D\u043E\u0435 - \u0432\u0441\u0435 \u043A\u0430\u0447\u0435\u0441\u0442\u0432\u0435\u043D\u043D\u043E \u0438 \u0431\u044B\u0441\u0442\u0440\u043E (\u043D\u0435 \u0432\u0437\u0438\u0440\u0430\u044F \u043D\u0430 \u043D\u0435 \u0441\u0430\u043C\u044B\u0439 \"\u0431\u044B\u0441\u0442\u0440\u044B\u0439\" \u0442\u0430\u0440\u0438\u0444). \u0415\u0441\u0442\u044C \u0432\u043E\u043F\u0440\u043E\u0441\u044B - \u0437\u0430\u043C\u0435\u0447\u0430\u0442\u0435\u043B\u044C\u043D\u044B\u0439 \u0410\u043B\u0435\u043A\u0441\u0435\u0439 \u0432\u0441\u0435\u0433\u0434\u0430 \u043F\u043E\u0434\u0441\u043A\u0430\u0436\u0435\u0442, \u043F\u043E\u0434\u0434\u0435\u0440\u0436\u0438\u0442, \u043E\u0442\u0440\u0435\u043C\u043E\u043D\u0442\u0438\u0440\u0443\u0435\u0442 \u0438/\u0438\u043B\u0438 \u043F\u0440\u043E\u0441\u0442\u043E \u0441\u0434\u0435\u043B\u0430\u0435\u0442 \u0441 \u043D\u0443\u043B\u044F. \u0415\u0441\u0442\u044C \u0437\u0430\u0434\u0443\u043C\u043A\u0430 \u0434\u043B\u044F \u0440\u0435\u0430\u043B\u0438\u0437\u0430\u0446\u0438\u0438 - \u0437\u0430\u043C\u0435\u0447\u0430\u0442\u0435\u043B\u044C\u043D\u044B\u0439 \u0421\u0435\u0440\u0433\u0435\u0439 \u043E\u0431\u0441\u0443\u0434\u0438\u0442 \u0438 \u043F\u0440\u0435\u0434\u043B\u043E\u0436\u0438\u0442 \u0438\u0434\u0435\u0430\u043B\u044C\u043D\u044B\u0439 \u0432\u0430\u0440\u0438\u0430\u043D\u0442. \u0415\u0441\u0442\u044C \u043F\u0440\u043E\u0431\u043B\u0435\u043C\u0430 - \u0437\u0430\u043C\u0435\u0447\u0430\u0442\u0435\u043B\u044C\u043D\u044B\u0435 \u041D\u0430\u0434\u0435\u0436\u0434\u0430 \u0438 \u0420\u043E\u043C\u0430\u043D \u043F\u043E\u0447\u0438\u043D\u044F\u0442, \u043F\u043E\u043F\u0440\u0430\u0432\u044F\u0442, \u0441\u0434\u0435\u043B\u0430\u044E\u0442! \u0420\u0435\u0431\u044F\u0442\u0430 \u0434\u043E\u043A\u0430\u0437\u0430\u043B\u0438, \u0447\u0442\u043E \u044D\u0442\u0430 CMS - \u043C\u043E\u0449\u043D\u0430\u044F \u0438 \u0433\u0440\u0430\u043C\u043E\u0442\u043D\u0430\u044F \u0441\u0438\u0441\u0442\u0435\u043C\u0430 \u0443\u043F\u0440\u0430\u0432\u043B\u0435\u043D\u0438\u044F. \u041D\u0430\u0434\u0435\u044E\u0441\u044C, \u0447\u0442\u043E \u043D\u0430\u0448\u0435 \u0441\u043E\u0442\u0440\u0443\u0434\u043D\u0438\u0447\u0435\u0441\u0442\u0432\u043E \u0437\u0430\u0442\u044F\u043D\u0435\u0442\u0441\u044F \u043D\u0430\u0434\u043E\u043B\u0433\u043E! \u0421\u043F\u0430\u0441\u0438\u0431\u043E!!!"
